import React from 'react';
import { Button, Navbar, Nav, NavDropdown, FormControl,Form } from 'react-bootstrap'
import { LineChart, Line, CartesianGrid, XAxis, YAxis, Tooltip } from 'recharts';
import { PureComponent } from 'react';
import {
  AreaChart, Area} from 'recharts';
import {
  BarChart, Bar, Cell, Legend, ReferenceLine,
} from 'recharts';
import {
  PieChart, Pie, Sector
} from 'recharts';
const RADIAN = Math.PI / 180;
  const data2 = [
  {
    name: '10 am', users: 4000, pv: 2400, amt: 2400,
  },
  {
    name: '12 pm', users: 3000, pv: 1398, amt: 2210,
  },
  {
    name: '2 pm', users: 2000, pv: 9800, amt: 2290,
  },
  {
    name: '4 pm', users: 2780, pv: 3908, amt: 2000,
  },
  {
    name: '6 pm', users: 1890, pv: 4800, amt: 2181,
  },
  {
    name: '8 pm', users: 2390, pv: 3800, amt: 2500,
  },
  {
    name: '10 pm', users: 3490, pv: 4300, amt: 2100,
  },
];

const data3 = [
  { name: 'Group A', value: 400 },
  { name: 'Group B', value: 300 },
  { name: 'Group C', value: 300 },
  { name: 'Group D', value: 200 },
];

const dataBars = [
  {
    name: 'Page A', uv: 4000, pv: 2400, amt: 2400,
  },
  {
    name: 'Page B', uv: 3000, pv: 1398, amt: 2210,
  },
  {
    name: 'Page C', uv: 2000, pv: 8, amt: 2290,
  },
  {
    name: 'Page D', uv: 2780, pv: 3908, amt: 2000,
  },
  {
    name: 'Page E', uv: 18, pv: 4800, amt: 2181,
  },
  {
    name: 'Page F', uv: 2390, pv: 3800, amt: 2500,
  },
  {
    name: 'Page G', uv: 3490, pv: 4300, amt: 2100,
  },
];
const COLORS = ['#0088FE', '#00C49F', '#FFBB28', '#FF8042'];

const renderCustomizedLabel = ({
  cx, cy, midAngle, innerRadius, outerRadius, percent, index,
}) => {
   const radius = innerRadius + (outerRadius - innerRadius) * 0.5;
  const x = cx + radius * Math.cos(-midAngle * RADIAN);
  const y = cy + radius * Math.sin(-midAngle * RADIAN);

  return (
    <text x={x} y={y} fill="white" textAnchor={x > cx ? 'start' : 'end'} dominantBaseline="central">
      {`${(percent * 100).toFixed(0)}%`}
    </text>
  );
};

const renderCustomizedLabelBars = (props) => {
  const {
    x, y, width, height, value,
  } = props;
  const radius = 10;

  return (
    <g>
      <circle cx={x + width / 2} cy={y - radius} r={radius} fill="#8884d8" />
      <text x={x + width / 2} y={y - radius} fill="#fff" textAnchor="middle" dominantBaseline="middle">
        {value.split(' ')[1]}
      </text>
    </g>
  );
};


const data = [{name: 'Enero', users: 100, pv: 2600, amt: 2900},{name: 'Febrero', users: 400, pv: 1200, amt: 1400},{name: 'Marzo', users: 400, pv: 2400, amt: 2400}];

const LandingPage = () => (
  <div>
    <div class="jumbotron">
  <h1>Dashboard de Colombia Viva</h1>
  <p>Aquí encontrarás toda la información de negocio de la app</p>
</div>

<div class="container">
  <div class="row">
    <div class="col-sm-6">
      <h4>Pregunta 1: Descargas de la aplicación al mes</h4>
        <LineChart width={500} height={250} data={data} margin={{ top: 5, right: 20, bottom: 5, left: 0 }}>
           <Line type="monotone" dataKey="users" stroke="#2d572c" />
           <CartesianGrid stroke="#ccc" strokeDasharray="5 5" />
           <XAxis dataKey="name" />
           <YAxis />
           <Tooltip />
         </LineChart>
    </div>
    <div class="col-sm-6 other">
      <h4>Pregunta 2: Ubicaciones más buscadas</h4>
        <AreaChart
            width={500}
            height={250}
            data={data2}
            margin={{
              top: 10, right: 30, left: 0, bottom: 0,
            }}
          >
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="name" />
            <YAxis />
            <Tooltip />
            <Area type="monotone" dataKey="users" stroke="#8884d8" fill="#2d572c" />
          </AreaChart>
    </div>
  </div>
</div>
<div class="container mt-5">
  <div class="row">
    <div class="col-sm-6">
      <h4>Pregunta 3: Rango de edad de usuarios</h4>
        <BarChart
        width={500}
        height={300}
        data={dataBars}
        margin={{
          top: 5, right: 30, left: 20, bottom: 5,
        }}
      >
        <CartesianGrid strokeDasharray="3 3" />
        <XAxis dataKey="name" />
        <YAxis />
        <Tooltip />
        <Legend />
        <Bar dataKey="pv" fill="#8884d8" minPointSize={5}>
          <LabelList dataKey="name" content={renderCustomizedLabelBars} />
        </Bar>
        <Bar dataKey="uv" fill="#82ca9d" minPointSize={10} />
      </BarChart>
    </div>
    <div class="col-sm-6 other">
      <h4>Pregunta 4: Parques más frecuentados</h4>
        <BarChart
        width={500}
        height={300}
        data={data2}
        stackOffset="sign"
        margin={{
          top: 5, right: 30, left: 20, bottom: 5,
        }}
      >
        <CartesianGrid strokeDasharray="3 3" />
        <XAxis dataKey="name" />
        <YAxis />
        <Tooltip />
        <Legend />
        <ReferenceLine y={0} stroke="#000" />
        <Bar dataKey="pv" fill="#01A9DB" stackId="stack" />
        <Bar dataKey="users" fill="#82ca9d" stackId="stack" />
      </BarChart>
    </div>
  </div>
</div>
<div class="container mt-5">
  <div class="row">
    <div class="col-sm-6">
      <h4>Pregunta 5: Parques con poca información</h4>
        <LineChart width={500} height={250} data={data} margin={{ top: 5, right: 20, bottom: 5, left: 0 }}>
           <Line type="monotone" dataKey="users" stroke="#2d572c" />
           <CartesianGrid stroke="#ccc" strokeDasharray="5 5" />
           <XAxis dataKey="name" />
           <YAxis />
           <Tooltip />
         </LineChart>
    </div>
    <div class="col-sm-6 other">
      <h4>Pregunta 6: Usuarios con mayor interacción</h4>
        <AreaChart
            width={500}
            height={250}
            data={data2}
            margin={{
              top: 10, right: 30, left: 0, bottom: 0,
            }}
          >
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="name" />
            <YAxis />
            <Tooltip />
            <Area type="monotone" dataKey="users" stroke="#8884d8" fill="#2d572c" />
          </AreaChart>
    </div>
  </div>
</div>
<div class="container mt-5">
  <div class="row">
    <div class="col-sm-6">
      <h4>Pregunta 7: Descargas de la aplicación al mes</h4>
        <LineChart width={500} height={250} data={data} margin={{ top: 5, right: 20, bottom: 5, left: 0 }}>
           <Line type="monotone" dataKey="users" stroke="#2d572c" />
           <CartesianGrid stroke="#ccc" strokeDasharray="5 5" />
           <XAxis dataKey="name" />
           <YAxis />
           <Tooltip />
         </LineChart>
    </div>
    <div class="col-sm-6 other">
      <h4>Pregunta 8: Ubicaciones más buscadas</h4>
        <AreaChart
            width={500}
            height={250}
            data={data2}
            margin={{
              top: 10, right: 30, left: 0, bottom: 0,
            }}
          >
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="name" />
            <YAxis />
            <Tooltip />
            <Area type="monotone" dataKey="users" stroke="#8884d8" fill="#2d572c" />
          </AreaChart>
    </div>
  </div>
</div>
<div class="container mt-5">
  <div class="row">
    <div class="col-sm-6">
      <h4>Pregunta 9: Rango de edad de usuarios</h4>
        <PieChart width={400} height={400}>
       <Pie
         data={data3}
         cx={200}
         cy={200}
         labelLine={false}
         label={renderCustomizedLabel}
         outerRadius={80}
         fill="#8884d8"
         dataKey="value"
       >
         {
           data.map((entry, index) => <Cell key={`cell-${index}`} fill={COLORS[index % COLORS.length]} />)
         }
       </Pie>
     </PieChart>
    </div>
    <div class="col-sm-6 other">
      <h4>Pregunta 10: Parques más frecuentados</h4>
        <BarChart
        width={500}
        height={300}
        data={data2}
        stackOffset="sign"
        margin={{
          top: 5, right: 30, left: 20, bottom: 5,
        }}
      >
        <CartesianGrid strokeDasharray="3 3" />
        <XAxis dataKey="name" />
        <YAxis />
        <Tooltip />
        <Legend />
        <ReferenceLine y={0} stroke="#000" />
        <Bar dataKey="pv" fill="#01A9DB" stackId="stack" />
        <Bar dataKey="users" fill="#82ca9d" stackId="stack" />
      </BarChart>
    </div>
  </div>
</div>
<div class="container mt-5">
  <div class="row">
    <div class="col-sm-6">
      <h4>Pregunta 11: Parques con poca información</h4>
        <LineChart width={500} height={250} data={data} margin={{ top: 5, right: 20, bottom: 5, left: 0 }}>
           <Line type="monotone" dataKey="users" stroke="#2d572c" />
           <CartesianGrid stroke="#ccc" strokeDasharray="5 5" />
           <XAxis dataKey="name" />
